. \u0415\u0441\u043b\u0438 \u0431\u0430\u043d\u043a\u0438\u0440 \u043d\u0430\u0431\u0440\u0430\u043b \u043e\u0442 0 \u0434\u043e 4 \u043e\u0447\u043a\u043e\u0432, \u0442\u043e \u043e\u043d \u043f\u043e\u043b\u0443\u0447\u0430\u0435\u0442 \u0442\u0440\u0435\u0442\u044c\u044e \u043a\u0430\u0440\u0442\u0443, \u0435\u0441\u043b\u0438 \u0431\u043e\u043b\u044c\u0448\u0435 5 -- \u043d\u0435\u0442, \u0435\u0441\u043b\u0438 \u0443 \u0431\u0430\u043d\u043a\u0438\u0440\u0430 5 \u043e\u0447\u043a\u043e\u0432, \u0442\u043e \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043e \u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u0438 \u0442\u0440\u0435\u0442\u044c\u0435\u0439 \u043a\u0430\u0440\u0442\u044b \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0435\u0442\u0441\u044f \u0432 \u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 \u043e\u0442 \u043a\u0430\u0440\u0442 \u0438\u0433\u0440\u043e\u043a\u0430. \u0412 \u0438\u0442\u043e\u0433\u0435 \u0432\u044b\u0438\u0433\u0440\u044b\u0432\u0430\u0435\u0442 \u0441\u0442\u0430\u0432\u043a\u0430 \u043d\u0430 \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043d\u0430\u0431\u0440\u0430\u043b \u0431\u043e\u043b\u044c\u0448\u0435 \u043e\u0447\u043a\u043e\u0432 &nbsp;(\u0442\u043e \u0435\u0441\u0442\u044c \u0435\u0441\u043b\u0438 \u0434\u0438\u043b\u0435\u0440 \u043d\u0430\u0431\u0440\u0430\u043b \u0431\u043e\u043b\u044c\u0448\u0435, \u0442\u043e \u0432\u044b\u0438\u0433\u0440\u044b\u0432\u0430\u0435\u0442 \u0441\u0442\u0430\u0432\u043a\u0430 <<\u0411\u0430\u043d\u043a>>, \u0435\u0441\u043b\u0438 \u043c\u0435\u043d\u044c\u0448\u0435 -- <<\u0418\u0433\u0440\u043e\u043a>>). \u041f\u0440\u0438 \u0440\u0430\u0432\u0435\u043d\u0441\u0442\u0432\u0435 \u043e\u0447\u043a\u043e\u0432 \u0441\u0442\u0430\u0432\u043a\u0438 \u043d\u0430 \u0438\u0433\u0440\u043e\u043a\u0430 \u0438 \u0431\u0430\u043d\u043a \u0432\u043e\u0437\u0432\u0440\u0430\u0449\u0430\u044e\u0442\u0441\u044f, \u0432\u044b\u0438\u0433\u0440\u044b\u0432\u0430\u0435\u0442 \u0441\u0442\u0430\u0432\u043a\u0430 <<\u041d\u0438\u0447\u044c\u044f>>.":{"fr":"Le participant &nbsp;(joueur ou banque) qui a 9 points, gagne. Le joueur qui a 8 points gagne si son adversaire a moins de point. Si aucun des joueurs n\u2019a 8 ou 9 points, ils peuvent prendre une troisi\u00e8me carte.<br>C\u2019est la r\u00e8gle de donne qui dit si le joueur doit prendre une troisi\u00e8me carte. Si le joueur obtient 5 points avec ses deux premi\u00e8res cartes, il doit prendre une troisi\u00e8me carte, s\u2019il obtient plus de 5 points, non. Si la banque a entre 0 et 4 points, elle doit prendre une troisi\u00e8me carte, si la banque a 6 points ou plus, non. Si la banque a tout juste 5 points, on d\u00e9cide si elle doit prendre une troisi\u00e8me carte en fonction des cartes de joueur. Celui qui a le plus de points gagne la mise &nbsp;(si l\u2019agent a plus de point, c\u2019est <<la banque>> qui gagne la mise, si l\u2019agent a moins de point, c\u2019est <<le joueur>> qui gagne la mise). Si le joueur et la banque ont le m\u00eame nombre de point, personne ne gagne","es":"El jugador o el Banquero quien tenga 9 puntos gana. El jugador que tenga 8 puntos gana si su oponente tiene menos puntos. Si no hay jugadores con 8 \u00f3 9 puntos, ambos pueden pedir la  tercera carta.<br>La regla de tercera carta indica si el jugador puede pedir la tercera carta. Si el jugador reune 5 puntos con las dos primeras cartas, recibe la tercera, si el jugador reune m\u00e1s de 5 puntos recibe nada. Si el banquero reune de 0 a 4 puntos, recibe la tercera carta, si el banquero tiene 6 o m\u00e1s puntos recibe nada. Si el banquero tiene exactamente 5 puntos, la decisi\u00f3n se toma teniendo en cuenta los puntos sacados por el jugador. Uno que est\u00e9 mas cerca de los 9 puntos gana.","tr":"\u00dcye & nbsp; (oynat\u0131c\u0131 veya bankac\u0131),  9 puan toplayan kazan\u0131r. 8 puana sahip oyuncu, rakip az puan  alarsa kazan\u0131r . Kat\u0131l\u0131mc\u0131lar\u0131n hi\u00e7birisinin  8 veya 9 puan\u0131 yoksa, \u00fc\u00e7\u00fcnc\u00fc bir kart elde etmek \u015fans\u0131na sahipsiniz. . <br> Oyuncuya ve \/ veya bankac\u0131ya otomatik bakkara oyununda \u00fc\u00e7\u00fcnc\u00fc bir kart verilecektir.   E\u011fer bir oyuncu   \u0130lk iki kartla 0 ile 5 puan aras\u0131nda puan alm\u0131\u015fsa, \u00fc\u00e7\u00fcnc\u00fc bir kart al\u0131r, e\u011fer fazla 5 puan\u0131 varsa , o zaman , \u00fc\u00e7\u00fcnc\u00fc bir kart ala bilmez.  E\u011fer bankac\u0131 0 ve  4  aras\u0131 puan alm\u0131\u015fsa , o da  \u00fc\u00e7\u00fcnc\u00fc bir kart al\u0131r, e\u011fer, e\u011fer fazla 5 puan\u0131 varsa , o zaman , \u00fc\u00e7\u00fcnc\u00fc bir kart ala bilmez.  E\u011fer bankac\u0131n\u0131n 5 puan\u0131 varsa, bu  zaman \u00fc\u00e7\u00fcnc\u00fc bir kart alma karar\u0131 oyuncunun kartlar\u0131ndan as\u0131l\u0131d\u0131r. Sonu\u00e7ta kim daha fazla puan alm\u0131\u015fsa o \u015fahsin bahisi kazan\u0131yor.  &nbsp;(yani, sat\u0131c\u0131 fazla puan alm\u0131\u015fsa , o zaman <<Banka>> kazan\u0131yor, az puan onunsa  bu  zaman  <<Oyuncu>>). Puan e\u015fitli\u011fi halinde,   oyuncu ve banka bahsinizi iade edersiniz, ,   kazan\u00e7 << Beraber>> bahisine gider.","cz":"S\u00e1zej\u00edc\u00ed & nbsp; (hr\u00e1\u010d nebo bank\u00e9\u0159), kter\u00fd z\u00edskal 9 bod\u016f, vyhr\u00e1v\u00e1. Hr\u00e1\u010d s 8 body, za p\u0159edpokladu, \u017ee soupe\u0159 z\u00edskal m\u00e9n\u011b, vzhr\u00e1v\u00e1. Pokud \u017e\u00e1dn\u00fd z \u00fa\u010dastn\u00edk\u016f nem\u00e1 8 nebo 9 bod\u016f, je mo\u017en\u00e9 z\u00edskat t\u0159et\u00ed kartu. <br> Pravidlo t\u0159et\u00ed karty ur\u010duje, kdy bude hr\u00e1\u010di a \/ nebo bank\u00e9\u0159i automaticky vyd\u00e1na t\u0159et\u00ed karta ve h\u0159e Baccarat. V p\u0159\u00edpad\u011b, \u017ee prvn\u00edmi dv\u011bma kartami z\u00edskal hr\u00e1\u010d  0-5 bod\u016f, dost\u00e1v\u00e1 t\u0159et\u00ed kartu, pokud z\u00edskal v\u00edce ne\u017e 5 bod\u