438\u0440), \u043d\u0430\u0431\u0440\u0430\u0432\u0448\u0438\u0439 9 \u043e\u0447\u043a\u043e\u0432, \u0432\u044b\u0438\u0433\u0440\u044b\u0432\u0430\u0435\u0442. \u0418\u0433\u0440\u043e\u043a, \u043d\u0430\u0431\u0440\u0430\u0432\u0448\u0438\u0439 8 \u043e\u0447\u043a\u043e\u0432, \u043f\u0440\u0438 \u0443\u0441\u043b\u043e\u0432\u0438\u0438, \u0447\u0442\u043e \u043f\u0440\u043e\u0442\u0438\u0432\u043d\u0438\u043a \u043d\u0430\u0431\u0440\u0430\u043b \u043c\u0435\u043d\u044c\u0448\u0435, \u0432\u044b\u0438\u0433\u0440\u044b\u0432\u0430\u0435\u0442. \u0415\u0441\u043b\u0438 \u043d\u0438 \u0443 \u043e\u0434\u043d\u043e\u0433\u043e \u0438\u0437 \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u043e\u0432 \u043d\u0435\u0442 8 \u0438\u043b\u0438 9 \u043e\u0447\u043a\u043e\u0432, \u0442\u043e \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e \u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u0435 \u0442\u0440\u0435\u0442\u044c\u0435\u0439 \u043a\u0430\u0440\u0442\u044b.<br>\u041f\u0440\u0430\u0432\u0438\u043b\u043e \u0442\u0440\u0435\u0442\u044c\u0435\u0439 \u043a\u0430\u0440\u0442\u044b \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u044f\u0435\u0442, \u043a\u043e\u0433\u0434\u0430 \u0438\u0433\u0440\u043e\u043a\u0443 \u0438\/\u0438\u043b\u0438 \u0431\u0430\u043d\u043a\u0438\u0440\u0443 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0432\u044b\u0434\u0430\u0435\u0442\u0441\u044f \u0442\u0440\u0435\u0442\u044c\u044f \u043a\u0430\u0440\u0442\u0430 \u043f\u0440\u0438 \u0438\u0433\u0440\u0435 \u0432 \u0431\u0430\u043a\u043a\u0430\u0440\u0443. \u0415\u0441\u043b\u0438 \u0438\u0433\u0440\u043e\u043a \u043f\u0435\u0440\u0432\u044b\u043c\u0438 \u0434\u0432\u0443\u043c\u044f \u043a\u0430\u0440\u0442\u0430\u043c\u0438 \u043d\u0430\u0431\u0440\u0430\u043b \u043e\u0442 0 \u0434\u043e 5 \u043e\u0447\u043a\u043e\u0432, \u0442\u043e \u043e\u043d \u043f\u043e\u043b\u0443\u0447\u0430\u0435\u0442 \u0442\u0440\u0435\u0442\u044c\u044e \u043a\u0430\u0440\u0442\u0443, \u0435\u0441\u043b\u0438 \u043d\u0430\u0431\u0440\u0430\u043d\u043e \u0431\u043e\u043b\u044c\u0448\u0435 5 \u043e\u0447\u043a\u043e\u0432, \u0442\u043e \u043d\u0435 \u043f\u043e\u043b\u0443\u0447\u0430\u0435\u0442. \u0415\u0441\u043b\u0438 \u0431\u0430\u043d\u043a\u0438\u0440 \u043d\u0430\u0431\u0440\u0430\u043b \u043e\u0442 0 \u0434\u043e 4 \u043e\u0447\u043a\u043e\u0432, \u0442\u043e \u043e\u043d \u043f\u043e\u043b\u0443\u0447\u0430\u0435\u0442 \u0442\u0440\u0435\u0442\u044c\u044e \u043a\u0430\u0440\u0442\u0443, \u0435\u0441\u043b\u0438 \u0431\u043e\u043b\u044c\u0448\u0435 5 \u2014 \u043d\u0435\u0442, \u0435\u0441\u043b\u0438 \u0443 \u0431\u0430\u043d\u043a\u0438\u0440\u0430 5 \u043e\u0447\u043a\u043e\u0432, \u0442\u043e \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043e \u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u0438 \u0442\u0440\u0435\u0442\u044c\u0435\u0439 \u043a\u0430\u0440\u0442\u044b \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0435\u0442\u0441\u044f \u0432 \u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 \u043e\u0442 \u043a\u0430\u0440\u0442 \u0438\u0433\u0440\u043e\u043a\u0430. \u0412 \u0438\u0442\u043e\u0433\u0435 \u0432\u044b\u0438\u0433\u0440\u044b\u0432\u0430\u0435\u0442 \u0441\u0442\u0430\u0432\u043a\u0430 \u043d\u0430 \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043d\u0430\u0431\u0440\u0430\u043b \u0431\u043e\u043b\u044c\u0448\u0435 \u043e\u0447\u043a\u043e\u0432 &nbsp;(\u0442\u043e \u0435\u0441\u0442\u044c \u0435\u0441\u043b\u0438 \u0434\u0438\u043b\u0435\u0440 \u043d\u0430\u0431\u0440\u0430\u043b \u0431\u043e\u043b\u044c\u0448\u0435, \u0442\u043e \u0432\u044b\u0438\u0433\u0440\u044b\u0432\u0430\u0435\u0442 \u0441\u0442\u0430\u0432\u043a\u0430 \u00ab\u0411\u0430\u043d\u043a\u00bb, \u0435\u0441\u043b\u0438 \u043c\u0435\u043d\u044c\u0448\u0435 \u2014 \u00ab\u0418\u0433\u0440\u043e\u043a\u00bb). \u041f\u0440\u0438 \u0440\u0430\u0432\u0435\u043d\u0441\u0442\u0432\u0435 \u043e\u0447\u043a\u043e\u0432 \u0441\u0442\u0430\u0432\u043a\u0438 \u043d\u0430 \u0438\u0433\u0440\u043e\u043a\u0430 \u0438 \u0431\u0430\u043d\u043a \u0432\u043e\u0437\u0432\u0440\u0430\u0449\u0430\u044e\u0442\u0441\u044f, \u0432\u044b\u0438\u0433\u0440\u044b\u0432\u0430\u0435\u0442 \u0441\u0442\u0430\u0432\u043a\u0430 \u00ab\u041d\u0438\u0447\u044c\u044f\u00bb.":{"en":"Player or Banker having 9 points wins. Player having 8 points wins in case if opponent has less points. If no players with 8 or 9 points both can take third card.<br>Rule of third card defines whether player can take third card. If player scored 5 points on first two cards he gets third card, if player scored more then 5 points he gets nothing. If banker scored from 0 to 4 points he gets third card, if banker has 6 or more points he gets nothing. If banker has exactly 5 points decision is made by taking player's score into the account. One with number of points closer to 9 wins.","rs":"\u0423\u0447\u0435\u0441\u043d\u0438\u043a (\u0438\u0433\u0440\u0430\u0447 \u0438\u043b\u0438 \u0431\u0430\u043d\u043a\u0430\u0440), \u0441\u043a\u0443\u043f\u0438\u0432\u0448\u0438 9 \u043f\u043e\u0435\u043d\u0430 \u043f\u043e\u0431\u0435\u0452\u0443\u0458\u0435. \u0418\u0433\u0440\u0430\u045b \u0441\u043a\u0443\u043f\u0438\u0432\u0448\u0438 8 \u043f\u043e\u0435\u043d\u0430 \u043f\u0440\u0438 \u0443\u0441\u043b\u043e\u0432\u0438\u043c\u0430 \u0444\u0430 \u0458\u0435 \u043f\u0440\u043e\u0442\u0438\u043d\u0438\u043a \u0441\u043a\u0443\u043f\u0438\u043e \u043c\u0430\u045a\u0435, \u043f\u043e\u0431\u0435\u0452\u0443\u0458\u0435. \u0410\u0430\u043a\u043e \u043d\u0438\u043a\u043e \u043e\u0434 \u0443\u0447\u0435\u0441\u043d\u0438\u043a\u0430 \u043d\u0435\u043c\u0430 8 \u0438\u043b\u0438 9 \u043f\u043e\u0435\u043d\u0430, \u043e\u043d\u0434\u0430 \u0458\u0435 \u043c\u043e\u0433\u0443\u045b\u0435 \u0438\u0437\u0432\u043b\u0430\u0447\u0435\u045a\u0435 \u0442\u0440\u0435\u045b\u0435 \u043a\u0430\u0440\u0442\u0435. \u041f\u0440\u0430\u0432\u0438\u043b\u043e \u0442\u0440\u0435\u045b\u0435 \u043a\u0430\u0440\u0442\u0435 \u0437\u043d\u0430\u0447\u0438 \u0434\u0430 \u043a\u0430\u0434\u0430 \u0441\u0435 \u0438\u0433\u0440\u0430\u0447\u0443 \u0438\/\u0438\u043b\u0438 \u0431\u0430\u043d\u043a\u0430\u0440\u0443 \u0430\u0443\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u0438\u0437\u0431\u0430\u0446\u0443\u0458\u0435 \u0442\u0440\u0435\u045b\u0430 \u043a\u0430\u0440\u0442\u0430\u043f\u0440\u0438 \u0438\u0433\u0440\u0438 \u0411\u0430\u043a\u043a\u0430\u0440\u0443. \u0410\u043a\u043e \u0458\u0435 \u0438\u0433\u0440\u0430\u0447 \u0441\u0430 \u043f\u0440\u0432\u0435 \u0434\u0432\u0435 \u043a\u0430\u0440\u0442\u0435 \u0441\u043a\u0443\u043f\u0438\u043e \u043e\u0434 0 \u0434\u043e 5 \u043f\u043e\u0435\u043d\u0430, \u043e\u043d\u0434\u0430 \u043e\u043d \u0434\u043e\u0431\u0438\u0458\u0430 \u0442\u0440\u0435\u045b\u0443 \u043a\u0430\u0440\u0442\u0443, \u0430 \u0430\u043a\u043e \u0458\u0435 \u0441\u043a\u0443\u043f\u0438\u043e \u0432\u0438\u0448\u0435 \u043e\u0434 5 \u043f\u043e\u0435\u043d\u0430 \u043e\u043d\u0434\u0430 \u043d\u0435 \u0434\u043e\u0431\u0438\u0458\u0430. \u0410\u043a\u043e \u0458\u0435 \u0431\u0430\u043d\u043a\u0430\u0440 \u0441\u043a\u0443\u043f\u0438\u043e \u043e\u0434 0 \u0434\u043e 4 \u043f\u043e\u0435\u043d\u0430, \u043e\u043d\u0434\u0430 \u043e\u043d \u0434\u043e\u0431\u0438\u0458\u0430 \u0442\u0440\u0435\u045b\u0443 \u043a\u0430\u0440\u0442\u0443. \u0430\u043a\u043e \u0438\u043c\u0430 \u0432\u0438\u0448\u0435 \u043e\u0434 5 \u043f\u043e\u0435\u043d\u0430 \u043d\u0435 \u0434\u043e\u0431\u0438\u0458\u0430, \u0430 \u0430\u043a\u043e \u0438\u043c\u0430 \u0442\u0430\u0447\u043d\u043e 5 \u043e\u043d\u0434\u0430 \u043e\u0434\u043b\u0443\u043a\u0443 \u043e \u0434\u043e\u0431\u0438\u0458\u0430\u045a\u0443 \u0442\u0440\u0435\u045b\u0435 \u043a\u0430\u0440\u0442\u0435 \u0434\u043e\u043d\u043e\u0441\u0438\u043c\u043e \u0443 \u0437\u0430\u0432\u0438\u0441\u043d\u043e\u0441\u0442\u0438 \u043e\