c\u00fc kart\u0131 alma hakk\u0131n\u0131 kaybediyor. E\u011fer bankac\u0131 0 ve 4 puan aras\u0131nda toplad\u0131ysa o zaman \u00fc\u00e7\u00fcnc\u00fc kart\u0131 alabilmektedir, e\u011fer 5 puandan fazla toplad\u0131ysa alamamaktad\u0131r, e\u011fer bankac\u0131 tam 5 puan toplad\u0131ysa \u00fc\u00e7\u00fcnc\u00fc kart\u0131n ona verilmesi ile ilgili karar\u0131 onun sahip oldu\u011fu kartlar\u0131na g\u00f6re verilmektedir. Sonuncu olarak daha fazla puan & nbsp alan kat\u0131l\u0131mc\u0131 bahisi kazan\u0131r (yani e\u011fer bayi daha fazla toplad\u0131ysa o zaman ''BANKA'' bahsi kazan\u0131r, daha az ise oyuncu kazan\u0131r.","cz":"S\u00e1zej\u00edc\u00ed & nbsp; (hr\u00e1\u010d nebo bank\u00e9\u0159), kter\u00fd z\u00edskal 9 bod\u016f, vyhr\u00e1v\u00e1. Hr\u00e1\u010d s 8 body, za p\u0159edpokladu, \u017ee soupe\u0159 z\u00edskal m\u00e9n\u011b, vzhr\u00e1v\u00e1. Pokud \u017e\u00e1dn\u00fd z \u00fa\u010dastn\u00edk\u016f nem\u00e1 8 nebo 9 bod\u016f, je mo\u017en\u00e9 z\u00edskat t\u0159et\u00ed kartu. <br> Pravidlo t\u0159et\u00ed karty ur\u010duje, kdy bude hr\u00e1\u010di a \/ nebo bank\u00e9\u0159i automaticky vyd\u00e1na t\u0159et\u00ed karta ve h\u0159e Baccarat. V p\u0159\u00edpad\u011b, \u017ee prvn\u00edmi dv\u011bma kartami z\u00edskal hr\u00e1\u010d  0-5 bod\u016f, dost\u00e1v\u00e1 t\u0159et\u00ed kartu, pokud z\u00edskal v\u00edce ne\u017e 5 bod\u016f, pak ne. V p\u0159\u00edpad\u011b, \u017ee bank\u00e9\u0159 z\u00edskal 0-4 bod\u016f, dost\u00e1v\u00e1 t\u0159et\u00ed kartu, pokud v\u00edce ne\u017e 5 \u2013 pak ne, pokud bank\u00e9\u0159 z\u00edskal 5 bod\u016f, rozhodnut\u00ed o z\u00edsk\u00e1n\u00ed t\u0159et\u00ed karty z\u00e1vis\u00ed na kart\u00e1ch hr\u00e1\u010de. V d\u016fsledku vyhr\u00e1v\u00e1 s\u00e1zka na \u00fa\u010dastn\u00edka, kter\u00fd z\u00edskal v\u00edce bod\u016f, & nbsp; (to znamen\u00e1, jestli\u017ee bank\u00e9\u0159 z\u00edskal v\u00edce bod\u016f,  vyhr\u00e1v\u00e1 s\u00e1zka, << Bank>>,  kdy\u017e m\u00e9n\